import { useContext } from "react";

import MyContext from "../my_context";

const Carousel = () => {
    return(
        <div className="carousel slide" data-ride="carousel">
            <div className="carousel-inner">
                <div className="carousel-item active">
                    <img className="d-block h-10" src="https://images.unsplash.com/photo-1682685795463-0674c065f315?ixlib=rb-4.0.3&ixid=M3wxMjA3fDF8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1326&q=80" alt="imagen obra"></img>
                </div>
            </div>
        </div>   
    )
}
export default Carousel;
